import React, { Component } from 'react';

const url = "http://localhost:5000/SongWorld/Songworld";

class Song extends Component {
    constructor(props) {
        super(props)

        this.state = {
            song: ''
        }
    }

    render() {
        return (
            <React.Fragment>
                <h1>Song1</h1>
            </React.Fragment>


        )
    }

    componentDidMount(){
        fetch(url,{
            Method:'Get'})
            .then((res) => res.json())
            .then((post) =>{
                this.setState({song:post})
            })
    }
}

export default Song;
